//import packages from the scope
import {Typography,List,TextField,Checkbox ,Stack,FormControlLabel} from '@mui/material';
import {useEffect, useState} from 'react';

// load necessary variables from the scope
const {input,config,setConfig,setOutput,setLoading} = props;

// main function

export default function OSMDownloader(props) {
    const [inputValue, setInputValue] = useState({
        "city":config.city || "",
        "state":config.state || "",
        "country":config.country || ""
    });
    const [type, setType] = useState(
        {
        "buildings":config.buildings || false,
        "roads":config.roads || false,
        "amenities": config.amenities || true
        }
    );

    const handleCheck = (e) => {
        setType({...type, [e.target.id]: !type[e.target.id]});
        setConfig({...config, [e.target.id]: !type[e.target.id]});
    }

    const handleValueChange = (e) => {
        setInputValue({...inputValue, [e.target.id]: e.target.value});
    }

    const handleCommit = ()=>{
        setConfig({...config,...inputValue})
    }

    const getElementQuery = () => {
        let query = "";
        if (type.buildings){
            query += "way(area.searchArea)[building];";
        }
        if (type.roads){
            query += "way(area.searchArea)[highway];";
        }
        if (type.amenities){
            query += "node(area.searchArea)[amenity];";
        }
        return query;
    }

    const getOSMData = async () =>{
        //geoCode use Nominatim API
        const {city, state, country} = inputValue;
        const location = [city, state, country].join("%2C");
        const geoCodeApi = `https://nominatim.openstreetmap.org/search?X-Requested-With=overpass-turbo&format=json&q=${location}`;
        const locationData = await fetch(geoCodeApi).then(data => data.json());
        const osmID = locationData[0]?.osm_id;
        const osmType = locationData[0]?.osm_type;
        if (!osmID || !osmType) {
            console.error("Error: No valid OSM ID or Type found");
            return;
        }
        // console.log("GET OSM ID", osmID);
        //overpass API
        const query = getElementQuery();
        const overpassApi = "https://overpass-api.de/api/interpreter";

        let areaID;
        if (osmType === 'relation') {
            areaID = 3600000000 + osmID;
        } else {
            console.error("OSM Type is not a relation, area query may not work directly.");
            return;
        }
        const osmQuery = `
        [out:json];
        area(${areaID})->.searchArea;
        (${query});
        out geom;
        `;
        const geoData = await fetch(
            overpassApi,
            {
                method: "POST",
                body: "data="+ encodeURIComponent(osmQuery),
            },)
            .then(data=>data.json())
            .then(jsonData=>jsonData["elements"])
            .then(jsonData=>parseOSMData(jsonData))
            .catch(error => console.error("Error:", error));
        return geoData;
    }

    const parseOSMData = (jsonData) => {
        const nodes = jsonData.filter(element => element.type === "node");
        const ways = jsonData.filter(element => element.type === "way");

        const amenities = {type: "FeatureCollection", features: []};
        const roads = {type: "FeatureCollection", features: []};
        const buildings = {type: "FeatureCollection", features: []};

        nodes.forEach(node => {
            amenities.features.push({
                type: "Feature",
                geometry: {
                    type: "Point",
                    coordinates: [node.lon, node.lat]
                },
                properties: {...node.tags, "id": node.id, "type": "amenity"}
            })
        });

        ways.forEach(way => {
            const coordinates = way.geometry.map(node => [node.lon, node.lat]);
            if (way.tags.building){
                buildings.features.push({
                    type: "Feature",
                    geometry: {
                        type: "Polygon",
                        coordinates: [coordinates]
                    },
                    properties: {...way.tags, "id": way.id, "type": "building"}
                });
            }
            if (way.tags.highway){
                roads.features.push({
                    type: "Feature",
                    geometry: {
                        type: "LineString",
                        coordinates: coordinates
                    },
                    properties: {...way.tags, "id": way.id, "type": "road"}
                });
            }
        });
        let output = {};
        if (type.amenities && amenities.features.length > 0) output["amenities"] = amenities;
        if (type.roads && roads.features.length > 0) output["roads"] = roads;
        if (type.buildings && buildings.features.length > 0) output["buildings"] = buildings;
        return output;
    }

    useEffect(()=>{
        if (!(config.run&&inputValue.city&&inputValue.state&&inputValue.country)){
            setOutput({output:null});
        }else{
            setLoading(true)
            getOSMData()
            .then(geoData =>setOutput({...geoData}))
        }
    },[config.run,inputValue,type]);

    return (
        <List>
            <Stack spacing={1} sx={{p:1}}>
                <TextField id="city" placeholder="City" variant="outlined" 
                        onChange={handleValueChange} 
                        onFocus={()=>setConfig({...config, run:false})}
                        onMouseLeave = {handleCommit}
                        value = {inputValue.city}
                        size="small"
                        InputLabelProps={{style: { fontSize: 10 }}}
                        InputProps={{style: { fontSize: 8 }}}
                        />
                <Stack direction="row" spacing={1} sx={{width:"100%"}}>
                    <TextField id="state" placeholder="State" variant="outlined" onChange={handleValueChange} size="small"
                    fullWidth
                    onFocus={()=>setConfig({...config, run:false})}
                    onMouseLeave = {handleCommit}
                    value = {inputValue.state}
                    InputLabelProps={{style: { fontSize: 10 }}}
                    InputProps={{style: { fontSize: 8 }}}
                    />
                    <TextField id="country" placeholder="Country" variant="outlined" onChange={handleValueChange} size="small"
                    fullWidth
                    onFocus={()=>setConfig({...config, run:false})}
                    onMouseLeave = {handleCommit}
                    value={inputValue.country}
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    />
                </Stack>
                <Stack direction="row" spacing={0} pl={1}>
                    <FormControlLabel 
                        control={<Checkbox  id="buildings" size='small' checked={type.buildings} onClick={handleCheck}/>}
                        label = {<Typography variant="caption">buildings</Typography>} 
                    />
                    <FormControlLabel 
                        control={<Checkbox  id="roads" size='small' checked={type.roads} onClick={handleCheck}/>}
                        label = {<Typography variant="caption">roads</Typography>} 
                    />
                    <FormControlLabel 
                        control={<Checkbox  id="amenities" size='small' checked={type.amenities} onClick={handleCheck}/>}
                        label = {<Typography variant="caption">amenities</Typography>} 
                    />
                </Stack>
            </Stack>
        </List>
    );
}

