//import packages from the scope
import { TextField,MenuItem,Stack} from "@mui/material";
import { useEffect, useState } from "react";
import * as d3 from 'd3';

function rgbToHex(r, g, b) {
    function valToHex(c) {
      var hex = c.toString(16);
      return hex.length === 1 ? "0" + hex : hex;
    }
    return "#" + valToHex(r) + valToHex(g) + valToHex(b);
  }

/**
 * convert hex to rgb array
 */
function hexToRgb(hex) {
  var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  return result
    ? [
        parseInt(result[1], 16),
        parseInt(result[2], 16),
        parseInt(result[3], 16),
      ]
    : null;
}

/**
 * convert rgb string to array
 */

function rgbToArray(rgb) {
  var result = rgb.replace(/[^\d,]/g, "").split(",");
  return result
    ? [
      parseInt(result[0], 16),
      parseInt(result[1], 16),
      parseInt(result[2], 16),
    ]
  : null;
}

// load necessary variables from the scope
const {input,config,setConfig,setOutput} = props;

// main function
export default function Item() {
    const [range,setRange] = useState({
        min: 0,
        max: 1
    });

    const [values,setValues] = useState({
        option: config.option || "color",
        property: config.property || "",
        dataType: config.dataType || "",
        numCategories: config.numCategories || 10,
        colorScheme: config.colorScheme || "",
        dataRange: config.dataRange || [0,1]
    });

    const handleValueChange = (e,k) => {
        setValues({...values,[k]: e.target.value})
        setConfig({...config,[k]: e.target.value});
    }
    const handleRangeChange = (e,k) => {
        setRange({...range,[k]: e.target.value})
        if (k === "min") {
            setValues({...values,dataRange: [e.target.value,range.max]})
            setConfig({...config,dataRange: [e.target.value,range.max]});
        }else{
            setValues({...values,dataRange: [range.min,e.target.value]})
            setConfig({...config,dataRange: [range.min,e.target.value]});
        }
    }

    const itemList = ["color","lineColor","pointRadius","lineWidth","height"]

    const linearSchemes = ["interpolateRdBu","interpolatePuOr","interpolateSpectral","interpolatePiYG"];

    const ordinalSchemes = ["schemeRdYlBu","schemeRdBu","schemeSpectral","schemeBrBG"];

    const mappingValue = (v) => {
        if (!(input && input.geojson)) return
        let scale;
        let data = [];
        input.geojson.features.forEach(d => {
            data.push(d.properties[values.property]);
        });
        if (values.option ==="color" || values.option === "lineColor") {
            if (!(values.colorScheme && values.dataType && d3[values.colorScheme])) return v;
            if (values.dataType === "continuous" && d3[values.colorScheme](1)) {
                scale = d3.scaleLinear()
                    .domain(d3.extent(data))
                    .range([d3[values.colorScheme](0),d3[values.colorScheme](1)])
                return scale(v) && rgbToArray(scale(v));
            }else if (d3[values.colorScheme][values.numCategories]){
                scale = d3.scaleOrdinal()
                    .domain([...new Set(data)])
                    .range(d3[values.colorScheme][values.numCategories])
            return hexToRgb(scale(v));
            }
        }else {
            if (values.dataType === "continuous") {
                scale = d3.scaleLinear()
                .domain(d3.extent(data))
                .range([parseFloat(range.min),parseFloat(range.max)])
                return scale(v);
            }else{
                const min = parseFloat(range.min);
                const max = parseFloat(range.max);
                const stepSize = (max - min) / values.numCategories;
                const discreteRange = Array.from({length: values.numCategories}, (_, i) => min + i * stepSize);
                scale = d3.scaleOrdinal()
                .domain([...new Set(data)].sort(d3.descending))
                .range(discreteRange)
                return scale(v);
            }
        }
    }

    useEffect(() => {
        if (config.run && input && input.geojson) {
            const newData = {...input.geojson,
                features: input.geojson.features.map((d) => {
                    return {
                        ...d,
                        properties: {
                            ...d.properties,
                            [values.option]: mappingValue(d.properties[values.property])
                        }
                    }
                })
            }
            setOutput({geojson:newData});
        } else {
            setOutput({geojson:null});
        }
    }, [config.run,input,values]);

    return (
        <>
        <Stack spacing={1} sx={{p:1}}>
        {input && input.geojson && input.geojson.features[0] && 
            (<TextField fullWidth label="Aggregate Property" size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    onChange={(e)=>{handleValueChange(e,"property")}}
                    value = {values.property}
                    select
                    >
                    {
                    Object.keys(input.geojson.features[0].properties).map((property) => (
                        <MenuItem key={property} value={property}>
                        {property}
                        </MenuItem>
                    )) || <MenuItem value={""}>No Properties</MenuItem>
                    }
            </TextField>) 
            || <TextField fullWidth label="Aggregate Property" size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    disabled = {true}
                />
        }
        <Stack spacing={1}>
        <TextField fullWidth label="Options" size="small" select
            InputLabelProps={{style: { fontSize: 8 }}}
            InputProps={{style: { fontSize: 8}}}
            onChange={(e)=>{handleValueChange(e,"option")}}
            value={values.option}>
            {itemList.map((item) => (
                <MenuItem key={item} value={item}>
                    {item}
                </MenuItem>
            ))}
        </TextField>
        {
        <TextField fullWidth label="Data Type" size="small" select
        InputLabelProps={{style: { fontSize: 8 }}}
        InputProps={{style: { fontSize: 8}}}
        onChange={(e)=>{handleValueChange(e,"dataType")}}
        value={values.dataType}>
            <MenuItem value="continuous">Continuous</MenuItem>
            <MenuItem value="discrete">Discrete</MenuItem>
        </TextField>
        }
        {
        values.dataType === "discrete" &&
        <TextField fullWidth label="Number of Categories" size="small"
            InputLabelProps={{style: { fontSize: 8 }}} select
            InputProps={{style: { fontSize: 8}}}
            onChange={(e)=>{handleValueChange(e,"numCategories")}}
            value={values.numCategories}
            >
            {
                Array.from({length: 8}, (_, i) => (
                    <MenuItem key={i+2} value={i+3}>
                        {i+3}
                    </MenuItem>
                ))
            }
        </TextField>
        }
        {
        (values.option === "color" || values.option === "lineColor") &&
        (<TextField fullWidth label="Data Range" size="small" select
            InputLabelProps={{style: { fontSize: 8 }}}
            InputProps={{style: { fontSize: 8}}}
            onChange={(e)=>{handleValueChange(e,"colorScheme")}}
            value={values.colorScheme}>
                {
                    values.dataType === "continuous" && linearSchemes.reverse().map((scheme) => (
                        <MenuItem key={scheme} value={scheme}>
                            <div style={{ width: config.width, height: 10}}>
                            {Array.from({ length: 100 }, (_, i) => (
                                <div
                                    key={i}
                                    style={{
                                        width: config.width/100,
                                        height: 10,
                                        backgroundColor: d3[scheme](i/100),
                                        display: 'inline-block',
                                    }}
                                />
                            ))}
                            </div>
                        </MenuItem>
                    ))
                }
                {
                    (values.dataType === "discrete" && values.numCategories) && ordinalSchemes.reverse().map((scheme) => (
                        <MenuItem key={scheme} value={scheme} sx={{display:"felx", alignItems:"center"}}>
                            <div style={{ width: config.width, height: 10}}>
                                {d3[scheme][values.numCategories].map((c) => (
                                <div
                                    key={c}
                                    style={{
                                    width: config.width/values.numCategories,
                                    height: 10,
                                    backgroundColor: c,
                                    display: 'inline-block',
                                    }}
                                />
                                ))}
                            </div>
                        </MenuItem>
                    ))

                }
        </TextField>)
        || (
            <>
            <TextField fullWidth label="Min" size="small"
                InputLabelProps={{style: { fontSize: 8 }}}
                InputProps={{style: { fontSize: 8}}}
                onChange = {(e)=>handleRangeChange(e,"min")}
                value={range.min}
                type="number"
            />
            <TextField fullWidth label="Max" size="small" 
                InputLabelProps={{style: { fontSize: 8 }}}
                InputProps={{style: { fontSize: 8}}}
                onChange = {(e)=>handleRangeChange(e,"max")}
                value={range.max}
                type="number"
            />
            </>
        )
        }
        </Stack>
        </Stack>
        </>
    )
}

