import React, {useEffect, useState} from 'react';
import {TextField,MenuItem,Box, Stack,TextField,Button} from '@mui/material';
import { MuiColorInput } from 'mui-color-input'
import {DataGrid} from "@mui/x-data-grid";

// load necessary variables from the scope
const {input,config,setConfig,setOutput} = props;

function hexToRgb(hex) {
  var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  return result
    ? [
        parseInt(result[1], 16),
        parseInt(result[2], 16),
        parseInt(result[3], 16),
      ]
    : null;
}


// main function
export default function Grouping() {
    const [values,setValues] = useState({
        property: config.property || "",
    });
    const [rows,setRows] = useState(config.rows||[]);
    const [columns,setColumns] = useState([
        {field: "id", headerName: "ID", editable: false, type: 'number', width: 10},
        {field: "value", headerName: "Value", editable: false, type: 'string', width: 120},
        {field: "group", headerName: "Group", editable: true, type: 'string', width: 120 },
        {field: "action", headerName: "Color", editable: false, type: 'actions', width: 120,
            cellClassName: 'actions',
            getActions: (data) => {
                const {id,row} = data;
                const [color,setColor] = useState(row.color);
                const handleColorChange = (value) => {  
                    setRows((prev)=>prev.map(r => r.group === row.group ? {...r,color:value} : r));
                };
                useEffect(() => {   
                    row.color && setColor(row.color);
                },[row.color]);
                return [
                    <>
                    <div key = {id}>
                        <MuiColorInput 
                        size='small'
                        variant="standard"
                        key={`${id}-color-input`}
                        format="hex" value={color} 
                        onChange={(newValue)=>handleColorChange(newValue)}
                        />
                    </div>
                    </>
                ];
            }
        },
    ]);

    const handleValueChange = (e,k) => {
        setValues({...values,[k]: e.target.value})
        setConfig({...config,[k]: e.target.value});
    }

    useEffect(() => {
        if (!(input && input.geojson && values.property )) return;
        // Parse rows
        const data = input.geojson.features.map(d => d.properties[values.property]);
        const unique = [...new Set(data)];
        const newRows = unique.map((d,i) => {
            return {
                id: i,
                value: d,
                group: config.rows && config.rows[i] && config.rows[i].group || d,
                color: config.rows && config.rows[i] && config.rows[i].color || "#ffffff",
            }
        });
        setRows([...newRows]);
    }, [input,values]);

    useEffect(() => {
        if (!(input && input.geojson && config.run)) {
            setOutput(null);
            return
        };
        const newData = {...input.geojson,
            features: input.geojson.features.map((d) => {
                return {
                    ...d,
                    properties: {
                        ...d.properties,
                        group: d.properties[values.property] ? rows.find(r => r.value === d.properties[values.property])?.group : rows.find(r => !r.value).group,
                        color: d.properties[values.property] ? hexToRgb(rows.find(r => r.value === d.properties[values.property])?.color) : hexToRgb(rows.find(r => !r.value).color)
                    }
                }
            })
        }
        setOutput({geojson:newData});
    },[config.run]);

    return (
        <>
        <Box sx={{p:1}}>
        <Stack spacing={1}>
        {input && input.geojson && input.geojson.features[0] && 
            (<TextField fullWidth label="Property" size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    onChange={(e)=>{handleValueChange(e,"property")}}
                    value = {values.property}
                    select
                    >
                    {
                    Object.keys(input.geojson.features[0].properties).map((property) => (
                        <MenuItem key={property} value={property}>
                        {property}
                        </MenuItem>
                    )) || <MenuItem value={""}>No Properties</MenuItem>
                    }
            </TextField>) 
            || <TextField fullWidth label="Property" size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    disabled = {true}
                />
        }
        {input && input.geojson && input.geojson.features[0] && 
        <DataGrid
            rowHeight={20}
            columnHeaderHeight = {30}
            columnBufferPx ={50}
            rows={rows}
            columns={columns}
            size="small"
            disableColumnFilter
            hideFooter
            editMode='cell'
            processRowUpdate={(newRow, oldRow) => {
                setRows(rows.map(row => row.id === oldRow.id ? newRow : row));
                return newRow}}
            onProcessRowUpdateError={(error, newRow, oldRow) => {console.log(error)}}
            sx={{
                "& .MuiDataGrid-footerContainer":{
                    height:30,
                    minHeight:30
                },
                "& .MuiDataGrid-scrollbar":{
                    display:"none"
                }
            }}
        />
        }
        <Button variant='outlined' onClick={()=>{
            setConfig({...config,rows})
        }}>
            Save
        </Button>
        </Stack>
        </Box>
        </>
    )
}

