//import packages from the scope
import {Stack,MenuItem,TextField} from '@mui/material';
import { useEffect,useState} from 'react';
import * as turf from '@turf/turf';

// load necessary variables from the scope
const {input,config,setConfig,setOutput} = props;

// main function
export default function GridCreator() {
    const [gridType, setGridType] = useState(config.gridType || "hexGrid");
    const [gridSize, setGridSize] = useState(config.gridSize || 100);
    const [aggInfo, setAggInfo] = useState({
        "property": config.aggInfo?.property || "id",
        "method":  config.aggInfo?.method || "none"
    })
    const aggOperators = ["count","sum","avg","min","max","none"];
    useEffect(() => {
        if (config.run && input && input.boundary) {
            let grid;
            grid = createGrid(input.boundary);
            if (input.geoData){
                grid = aggGrid(grid,input.geoData)
            }
            setOutput({grid})
        } else {
            setOutput({grid:null});
        }
    }, [config.run,input,gridType,gridSize,aggInfo.property,aggInfo.method]);

    // save values to config
    useEffect(() => {
        setConfig({...config,gridType,gridSize,aggInfo});
    }, [gridType,gridSize,aggInfo]);

    const createGrid = (boundary) => {
        let grid = null;
        try {
            const bbox = turf.bbox(boundary);
            //create grid
            switch (gridType) {
                case "hexGrid":
                    grid = turf.hexGrid(bbox,gridSize/1000);
                    break;
                case "squareGrid":
                    grid = turf.squareGrid(bbox,gridSize/1000);
                    break;
                case "triangleGrid":
                    grid = turf.triangleGrid(bbox,gridSize/1000);
                    break;
                default:
                    break;
            }
            } catch (error) {
                console.log(error);
                return;
        }
        return grid;
    }

    const aggGrid = (grid,geoData) => {
        // filter the grid outsize the hull polygon
        if (aggInfo.property){
            const hull = turf.convex(geoData);
            grid.features  = grid.features.filter((feature) => turf.booleanPointInPolygon(turf.centroid(feature),hull));
            const {property, method} = aggInfo;
            //Convert geoData to Point
            geoData.features = geoData.features.map((feature) => {
                if (feature.geometry.type === "Point") return feature;
                const point = turf.centerOfMass(feature.geometry);
                feature.geometry = point.geometry;
                feature.type = "Point"
                return feature;
            });
            // Collect the points in each grid
            let collection = turf.collect(grid, geoData, property, `${property}_${method}`);
            // Aggregate the property in each grid
            let aggFeatures = [];
            switch (method) {
                case "count":
                    aggFeatures = collection.features.map((feature) => {
                        feature.properties[`${property}_${method}`] = feature.properties[`${property}_${method}`].length;
                        feature.properties['color'] = feature.properties[`${property}_${method}`] ? [255,0,0,200]:[120, 165, 120, 150]
                        return feature;
                    });
                    break;
                case "sum":
                    aggFeatures = collection.features.map((feature) => {
                        feature.properties[`${property}_${method}`] = feature.properties[`${property}_${method}`].reduce((a,b) => a+b,0);
                        feature.properties['color'] = feature.properties[`${property}_${method}`] ? [255,0,0,200]:[120, 165, 120, 150]
                        return feature;
                    });
                    break;
                case "avg":
                    aggFeatures = collection.features.map((feature) => {
                        const numFeatures = feature.properties[`${property}_${method}`].length;
                        if (numFeatures>0){
                            const sum = feature.properties[`${property}_${method}`].reduce((a,b) => a+b,0);
                            feature.properties[`${property}_${method}`] = sum/numFeatures;
                        } else {
                            feature.properties[`${property}_${method}`] = 0;
                        }
                        feature.properties['color'] = feature.properties[`${property}_${method}`] ? [255,0,0,200]:[120, 165, 120, 150]
                        return feature;
                    });
                    break;
                case "min":
                    aggFeatures = collection.features.map((feature) => {
                        feature.properties[`${property}_${method}`] = Math.min(...feature.properties[`${property}_${method}`]);
                        feature.properties['color'] = feature.properties[`${property}_${method}`] ? [255,0,0,200]:[120, 165, 120, 150]
                        return feature;
                    });
                    break;
                case "max":
                    aggFeatures = collection.features.map((feature) => {
                        feature.properties[`${property}_${method}`] = Math.max(...feature.properties[`${property}_${method}`]);
                        feature.properties['color'] = feature.properties[`${property}_${method}`] ? [255,0,0,200]:[120, 165, 120, 150]
                        return feature;
                    });
                    break;
                case "none":
                    aggFeatures = collection.features.map((feature) => {
                        feature.properties['color'] = [120, 165, 120, 150]
                        return feature;
                    });
                    break;
                default:
                    aggFeatures = collection.features
                    break;
            }
            grid.features = aggFeatures;
        }
        grid.properties = {
            "gridType": gridType, 
            "gridSize": gridSize,
            "lineColor":[255, 255, 255, 200],
            "lineWidth": 500, 
            "stroked" : true,
            "wireframe": true,
        };
        return grid;
    }


    const handleTypeChange = (e) => {
        setGridType(e.target.value);
    }
    const handleValueChange = (e) => {
        setGridSize(e.target.value);
    }
    const handleAggChange = (e,key) => {
        const newAggInfo = {...aggInfo, [key]: e.target.value};
        setAggInfo(newAggInfo);
    }

    return (
        <>
        <Stack spacing={1.2} sx={{p:1, paddingTop:2}}>
            <Stack direction="row" spacing={1}>
                <TextField fullWidth label="Grid Type" value={gridType} size="small"
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    onChange={handleTypeChange}
                    select>
                    <MenuItem value="hexGrid">hexGrid</MenuItem>
                    <MenuItem value="squareGrid">squareGrid</MenuItem>
                    <MenuItem value="triangleGrid">triangleGrid</MenuItem>
                </TextField>
                <TextField label="Grid Size(m)" type="number" value={gridSize} size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    onChange={handleValueChange}
                    >
                </TextField>
            </Stack>
            {input && input.geoData && input.geoData.features[0] && 
            (<TextField label="Aggregate Property" size="small" 
                    InputLabelProps={{style: { fontSize: 8 }}}
                    InputProps={{style: { fontSize: 8}}}
                    onChange={(e)=>{handleAggChange(e,"property")}}
                    value = {aggInfo?.property||""}
                    select
                    >
                    {Object.keys(input.geoData.features[0].properties).map((property) => (
                        <MenuItem key={property} value={property}>
                        {property}
                        </MenuItem>
                    )) || <MenuItem value={""}>No Properties</MenuItem>
