export default function GeoJsonEditor() {
    const [columns, setColumns] = useState([]);
    const [origRows, setOrigRows] = useState([]);
    const [rows, setRows] = useState([]);
    const [filteredIds, setFilteredIds] = useState([]);
    const [filters, setFilters] = useState(config?.filters||[]);

    const filterValue = {
        "Logic":"AND",
        "Columns":"id",
        "Operator":"",
        "Value":""
    };
    const handleAddFilter = () => { 
        setFilters([...filters, filterValue])
        setConfig({...config, run:false})
    }
    const handleDeleteFilter = () => {
        setFilters(filters.slice(0,-1));
    }
    const handleUpdateFilter = (idx,newFilter) => {
        const newFilters = filters.map((filter,i) => 
            i === idx ? 
            newFilter : filter
        )
        setFilters(newFilters);
    }

    // save filters to config
    useEffect(() => {   
        setConfig({...config,filters:filters});
    }, [filters]);

    useEffect(() => {
        if (!(input && input.input)) return;
        let columns = [];
        let rows = [];
        const geoData = input.input;
        if (geoData){
            const {features} = geoData; 
            const properties = features.length>0 ? features[0].properties : {};
            if (!(Object.keys(properties).includes("id"))){
                columns = [{field: "id", headerName: "ID", editable: false, type: 'number', width: 30}];
            };
            for (let key in properties) {
                const type = typeof properties[key];
                columns.push({
                    field: key,
                    headerName: key,
                    width:70,
                    type: type==='number'? 'number' : 'string',
                    editable: true,
                })
            }
            features.forEach((feature,idx) => {
                const properties = feature.properties;
                let row = {};
                if (!(Object.keys(properties).includes("id"))){
                    row.id = idx;
                };
                for (let key in properties) {
                    row[key] = properties[key];
                }
                rows.push(row);
            });
        }
        setColumns([...columns]);
        setRows([...rows]);
        setOrigRows([...rows]);
    }, [input]);

    const filterRows = (filter)=>{
        const {Columns,Operator,Value} = filter;
        if (Columns==='' || Operator==='' || Value==='' || !origRows || columns.length===0){
            return rows
        };
        const column = columns.find(column => column.field === Columns);
        const type = column.type;
        switch (type){
            case "number":
                return origRows.filter(row => {
                    switch (Operator){
                        case "==":
                            return (row[Columns] == Value);
                        case ">=":
                            return (row[Columns] >= Value);
                        case ">":
                            return (row[Columns] > Value);
                        case "<=":
                            return (row[Columns] <= Value);
                        case "<":
                            return (row[Columns] < Value);
                        case "!=":
                            return (row[Columns] != Value);
                    }
                });
            case "string":
                return origRows.filter(row => {
                    switch (Operator){
                        case "contains":
                            return JSON.stringify(row[Columns])?.includes(Value);
                        case "starts with":
                            return JSON.stringify(row[Columns])?.startsWith(Value);
                        case "ends with":
                            return JSON.stringify(row[Columns])?.endsWith(Value);
                    }
                });
        }

    }

    useEffect(() => {
        if (origRows.length===0) return
        if (!filters || filters && filters.length === 0){
            setRows(origRows);
        }else{
        let currentRows = [...origRows]
        filters.forEach(filter => {
            const {Logic} = filter;
            const result = filterRows(filter);
            switch (Logic){
                case "AND":
                    currentRows = result ? currentRows.filter(row => result?.includes(row)):currentRows;
                    break;
                case "OR":
                    currentRows = result ? currentRows.concat(result):currentRows;
                    break;
                case "NOT":
                    currentRows= result ? currentRows.filter(row => !result?.includes(row)):currentRows;
                    break;
            }
        });
        setRows(currentRows);
        }
    }, [filters,config.run,origRows]);

    useEffect(() => {
        if (!(input && input.input && rows.length>0 && config.run)) {
            setOutput(null);
            return;
        };
        const geoData = input.input;
        let filteredRows = [...rows];
        if (filteredIds && filteredIds.length>0){
            filteredRows = rows.filter(row => filteredIds.includes(row.id))
        };
        const filteredFeatures = geoData.features.filter((feature,idx) => {
            if (!(Object.keys(feature.properties).includes("id"))) {
                return filteredRows.find(row => row.id === idx);
            }else{
                return filteredRows.find(row => row.id === feature.properties.id);
            }
        });
        setOutput({"output":{type:"FeatureCollection",features:filteredFeatures}});
    }, [rows, config.run, input && input.input]);

    return (
        <List>
            <Stack spacing={1} p={1} sx= {{paddingBottom:0}}>
                {filters.map((filter,idx) => (
                <Filter key={nanoid()} idx={idx} 
                columns={columns} 
                handleUpdateFilter={handleUpdateFilter} 
                filter={filter}
                run = {config.run}
                />
                ))}
            <Stack direction="row" spacing={1} sx={{alignItems:"right"}}>
                <Typography variant="caption">Filters</Typography>
                <Icon.AddCircle onClick={handleAddFilter} sx={{width:"15px",height:"15px",cursor:"pointer"}}/>
                <Icon.RemoveCircle onClick={handleDeleteFilter} sx={{width:"15px",height:"15px",cursor:"pointer"}}/>
            </Stack>
            </Stack>
            <Stack p={1}>
            <DataGrid
                rowHeight={20}
                columnHeaderHeight = {30}
                columnBufferPx ={50}
                rows={rows}
                columns={columns}
                size="small"
                initialState={{
                    pagination: {
                        paginationModel: { page: 0, pageSize: 20 },
                    },
                    }}
                pageSizeOptions={[20, 40]}
                checkboxSelection
                disableColumnFilter
                onRowSelectionModelChange={(ids) => {setFilteredIds(ids)}}
                processRowUpdate={(newRow, oldRow) => {setRows(rows.map(row => row.id === oldRow.id ? newRow : row));return newRow}}
                onProcessRowUpdateError={(error, newRow, oldRow) => {console.log(error)}}
                editMode='cell'
                sx={{
                    "& .MuiDataGrid-footerContainer":{
                        height:30,
                        minHeight:30
                    },
                    "& .MuiDataGrid-scrollbar":{
                        display:"none"
                    }
                }}
            />
            </Stack>
        </List>
    );
}

