export default function FormInput() {
  const initialRows = config?.rows || [
    {
      id: nanoid(),
      name: 'number',
      type: 'int',
      value: 100,
    },
  ];

  const actionColumn = {
      field: 'actions',
      type: 'actions',
      headerName: 'Actions',
      width: 70,
      cellClassName: 'actions',
      getActions: ({ id }) => {
        const isInEditMode = rowModesModel[id]?.mode === GridRowModes.Edit;

        if (isInEditMode) {
          return [
            <GridActionsCellItem
              icon={<Icon.Save />}
              label="Save"
              sx={{
                color: 'primary.main',
              }}
              onClick={handleSaveClick(id)}
            />,
            <GridActionsCellItem
              icon={<Icon.Cancel />}
              label="Cancel"
              className="textPrimary"
              onClick={handleCancelClick(id)}
              color="inherit"
            />,
          ];
        }

        return [
          <GridActionsCellItem
            icon={<Icon.Edit />}
            label="Edit"
            className="textPrimary"
            onClick={handleEditClick(id)}
            color="inherit"
          />,
          <GridActionsCellItem
            icon={<Icon.Delete />}
            label="Delete"
            onClick={handleDeleteClick(id)}
            color="inherit"
          />,
        ];
      },
    }

  const initialColumns = config.columns || [];

  const [rows, setRows] = useState(initialRows);
  const [columns, setColumns] = useState(initialColumns);
  const [rowModesModel, setRowModesModel] = useState({});

  const updateRow = () => {
    setConfig({ ...config, rows});
  };

  useEffect(() => {
    if (rows !== config.rows) {
      updateRow();
    }
  }, [rows]);

  useEffect(() => {
    if (columns !== config.columns) {
      setConfig({ ...config, columns });
    }
  }, [columns]);

  useEffect(()=>{
    setOutput({ output: rows });
  },[rows,config.run])

  const handleRowEditStop = (params, event) => {
    if (params.reason === GridRowEditStopReasons.rowFocusOut) {
      event.defaultMuiPrevented = true;
    }
  };

  const handleEditClick = (id) => () => {
    setRowModesModel({ ...rowModesModel, [id]: { mode: GridRowModes.Edit } });
  };

  const handleSaveClick = (id) => () => {
    setRowModesModel({ ...rowModesModel, [id]: { mode: GridRowModes.View } });
  };

  const handleDeleteClick = (id) => () => {
    setRows(rows.filter((row) => row.id !== id));
  };

  const handleCancelClick = (id) => () => {
    setRowModesModel({
      ...rowModesModel,
      [id]: { mode: GridRowModes.View, ignoreModifications: true },
    });

    const editedRow = rows.find((row) => row.id === id);
    if (editedRow.isNew) {
      setRows(rows.filter((row) => row.id !== id));
    }
  };

  const processRowUpdate = (newRow) => {
    const updatedRow = { ...newRow, isNew: false };
    setRows(rows.map((row) => (row.id === newRow.id ? updatedRow : row)));
    return updatedRow;
  };

  const handleRowModesModelChange = (newRowModesModel) => {
    setRowModesModel(newRowModesModel);
  };

  return (
    <Box
      sx={{
        height: '100%',
        width: '100%',
        '& .actions': {
          color: 'text.secondary',
        },
        '& .textPrimary': {
          color: 'text.primary',
        },
      }}
    >
      <DataGrid
        rows={rows}
        columns={[...columns,actionColumn]}
        size="small"
        editMode="row"
        rowHeight={20}
        columnHeaderHeight={30}
        columnBufferPx={50}
        rowModesModel={rowModesModel}
        onRowModesModelChange={handleRowModesModelChange}
        onRowEditStop={handleRowEditStop}
        processRowUpdate={processRowUpdate}
        disableColumnMenu
        disableColumnSorting
        hideFooter
        slots={{
          toolbar: EditToolbar,
        }}
        slotProps={{
          toolbar: { columns, rows, setRows, setRowModesModel, setColumns },
        }}
        sx={{
          '& .MuiDataGrid-footerContainer': {
            height: 30,
            minHeight: 30,
          },
          '& .MuiDataGrid-scrollbar': {
            display: 'none',
          },
        }}
      />
    </Box>
  );
}

import { useEffect, useState} from "react";
import {Typography,List,ListItem,Button,Slider, Stack} from '@mui/material';
import * as Icon from '@mui/icons-material';
import {LoadingButton} from "@mui/lab";
import * as d3 from 'd3';

const {input,config,setConfig,setOutput} = props

export default function FileInput() {
    const [loading, setLoading] = useState(false);

    const readFile = (file) => {
        return new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.onload = (event) => {
                if (file.name.endsWith('.json') || file.name.endsWith('.geojson')) {
                    const jsonData = JSON.parse(event.target.result);
                    resolve(jsonData);
                } else if(file.name.endsWith('.csv')){
                    const csvData  = d3.csvParse(event.target.result);
                    resolve(csvData);
                }else {
                    const textData = event.target.result;
                    resolve(textData);
                }
            };
            reader.onerror = (error) => {
                reject(error);
            };
            reader.readAsText(file);
        });
    };
    const handleFileChange = (e) =>{
        const files = e.target.files;
        setLoading(true);
        setTimeout(() => {
            readFile(files[0])
                .then(jsonData => {
                    setOutput({output:jsonData});
                    setLoading(false);
                })
                .finally(()=>setLoading(false))
        }, 2000);
    }
    return (
        <>
        <ListItem>
        <LoadingButton loading={loading} component="label" variant="outlined" fullWidth 
        startIcon={<Icon.CloudUpload/>}
        >
            <input type="file" onChange ={handleFileChange}
            style={{
                clip: 'rect(0 0 0 0)',
                clipPath: 'inset(50%)',
                height: 1,
                overflow: 'hidden',
                position: 'absolute',
                bottom: 0,
                left: 0,
                whiteSpace: 'nowrap',
                width: 1,
            }}
            accept=".geojson,.json,.csv,.txt"/>
            <Typography variant="caption">Upload File</Typography>
        </LoadingButton>
        </ListItem>
        </>
    );
}

