import { useEffect, useState} from "react";
import {Typography,List,ListItem,TextField, Stack} from '@mui/material';
import * as Icon from '@mui/icons-material';
import {LoadingButton} from "@mui/lab";

const {input,config,setConfig,setOutput} = props

export default function FileDownloader() {
    const [loading, setLoading] = useState(false);
    const [fileName, setFileName] = useState("data.json")

    const handleValueChange = (e)=>{
        setFileName(e.target.value)
    }
    const handleDownload = () => {
        if (!(input && input.input)) return;
        setLoading(true);
        // Convert input JSON to a Blob
        const blob = new Blob([JSON.stringify(input.input, null, 2)], { type: "application/json" });
        const url = URL.createObjectURL(blob);

        // Create a temporary anchor element and trigger download
        const link = document.createElement("a");
        link.href = url;
        link.download = fileName; // Specify the file name
        document.body.appendChild(link);
        link.click();

        // Cleanup
        document.body.removeChild(link);
        URL.revokeObjectURL(url);

        setLoading(false);
    };

    return (
        <>
        <Stack spacing={1} p={1}>
        <TextField 
        label = "file name"
        size="small"
        value ={fileName}
        onChange = {handleValueChange}
        >
        </TextField>
        <LoadingButton loading={loading} component="label" variant="outlined" fullWidth 
        startIcon={<Icon.CloudDownload/>}
        onClick={handleDownload}
        >
            <Typography variant="caption">Download File</Typography>
        </LoadingButton>
        </Stack>
        </>
    );
}

