import React, { useRef, useEffect, useState } from 'react';
import {
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  Box,
  TextField
} from '@mui/material';

const {setOutput,config} = props;

// Default interval of 0.1 seconds 
const defaultInterval = 0.1;

const CameraComponent = () => {
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const [devices, setDevices] = useState([]);
  const [selectedDeviceId, setSelectedDeviceId] = useState('');
  const [interval, setIntervalValue] = useState(defaultInterval); 
  const [intervalId, setIntervalId] = useState(null);
  const [isVideoReady, setIsVideoReady] = useState(false);

  const captureFrame = () => {
    if (videoRef.current && canvasRef.current && isVideoReady) {
      const canvas = canvasRef.current;
      const context = canvas.getContext('2d');
      const video = videoRef.current;
      canvas.width = video.videoWidth;
      canvas.height = video.videoHeight;
      context.drawImage(video, 0, 0, canvas.width, canvas.height);
      const base64Image = canvas.toDataURL('image/png');
      setOutput({output:base64Image});
    }
  };

  useEffect(() => {
    if (videoRef.current && videoRef.current.srcObject && !config.run) {
      const stream = videoRef.current.srcObject;
      const tracks = stream.getTracks();
      tracks.forEach(track => track.stop());
      videoRef.current.srcObject = null;
      setIsVideoReady(false);
    }
  },[config.run]);

  const handleVideoLoadedMetadata = () => {
    setIsVideoReady(true);
  };

  useEffect(() => {
    // Fetch available video devices
    navigator.mediaDevices.enumerateDevices()
      .then(deviceInfos => {
        const videoDevices = deviceInfos.filter(deviceInfo => deviceInfo.kind === 'videoinput');
        setDevices(videoDevices);
        if (videoDevices.length > 0) {
          setSelectedDeviceId(videoDevices[0].deviceId); // Select the first device by default
        }
      })
      .catch(error => console.error('Error enumerating devices: ', error));
  }, []);

  useEffect(() => {
    if (selectedDeviceId && config.run) {
      // Request access to the selected camera
      navigator.mediaDevices.getUserMedia({ video: { deviceId: selectedDeviceId } })
        .then(stream => {
          if (videoRef.current) {
            videoRef.current.srcObject = stream;
          }
        })
        .catch(error => console.error('Error accessing the camera: ', error));
    }

    // Cleanup function to stop the camera when the component unmounts or device changes
    return () => {
      if (videoRef.current && videoRef.current.srcObject) {
        const stream = videoRef.current.srcObject;
        const tracks = stream.getTracks();
        tracks.forEach(track => track.stop());
      }
    };
  }, [selectedDeviceId]);

  useEffect(() => {
    if (intervalId) {
      clearInterval(intervalId);
    }

    const id = setInterval(captureFrame, interval * 1000);
    setIntervalId(id);

    return () => clearInterval(id);
  }, [interval, selectedDeviceId, isVideoReady]);



  return (
    <Box sx={{p:1}}>
      <FormControl fullWidth>
        <InputLabel id="camera-select-label">Select Camera</InputLabel>
        <Select
          sx = {{height:"20px"}}
          labelId="camera-select-label"
          id="camera-select"
          value={selectedDeviceId}
          label="Select Camera"
          onChange={(e) => setSelectedDeviceId(e.target.value)}
        >
          {devices.map(device => (
            <MenuItem key={device.deviceId} value={device.deviceId}>
              {device.label || `Camera ${device.deviceId}`}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <Box mt={2}>
        <video
          ref={videoRef}
          autoPlay
          style={{ width: '100%' }}
          onLoadedMetadata={handleVideoLoadedMetadata}
        />
        <canvas ref={canvasRef} style={{ display: 'none' }}></canvas>
      </Box>
    </Box>
  );
};

